import ExpenseItem from "./components/ExpenseItem";

function App() {
  const items = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 450,
      date: new Date(2022, 2, 22),
    },
    {
      id: "e2",
      title: "Bike Insurance",
      amount: 350,
      date: new Date(2022, 2, 22),
    },
    { id: "e3", title: "Toilet paper", amount: 5, date: new Date(2022, 2, 22) },
    { id: "e4", title: "New Desk", amount: 150, date: new Date(2022, 2, 22) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={items[0].title}
        amount={items[0].amount}
        date={items[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={items[1].title}
        amount={items[1].amount}
        date={items[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={items[2].title}
        amount={items[2].amount}
        date={items[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={items[3].title}
        amount={items[3].amount}
        date={items[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
